// AnimalModal.js
import React from 'react';
import { Modal, Button } from 'react-bootstrap';

const AnimalModal = ({ animal }) => {
  return (
    <Modal show={true} onHide={() => {}}>
      <Modal.Header closeButton>
        <Modal.Title>{animal.name}</Modal.Title>
      </Modal.Header>
      <Modal.Body>
        <p>ID: {animal.id}</p>
        <p>Species: {animal.species}</p>
        <p>Family: {animal.family}</p>
        <p>Habitat: {animal.habitat}</p>
        <p>Place of Found: {animal.place_of_found}</p>
        <p>Diet: {animal.diet}</p>
        <p>Description: {animal.description}</p>
        <p>Weight (kg): {animal.weight_kg}</p>
        <p>Height (cm): {animal.height_cm}</p>
        <p>Image: {animal.image}</p>
      </Modal.Body>
      <Modal.Footer>
        <Button variant="secondary" onClick={() => {}}>Close</Button>
      </Modal.Footer>
    </Modal>
  );
};

export default AnimalModal;
